import styled from "styled-components";

import React, { Component } from 'react';

export default styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 250px;
  width: 100%;
  background-color: #000000;
  color: #fff;
  margin: 0 15px;
  font-size: 2em;
`;
